import React from 'react';
import Home_Carrousel from '../../../Components/Home_Carrousel/Home_Carrousel';
import './ann_hero.css';
import mainhomeimg from '../Ann_Hero/assets/mainhomeimg.png';



const Ann_Hero = () => {
  return (
    <div>
      <div className='main_home' style={{ backgroundImage: `url(${mainhomeimg})` }}>
       <span> <p className='main_home_p'>  <em className='main_home_text'> All the Services You Need <br></br> </em> <em className='main_home_undertext'>Right at Your Fingertips </em></p> </span>
      </div>

      <br></br>

      <div>
        <Home_Carrousel/>
      </div> 

    </div>
  );
};

export default Ann_Hero;
